import {FETCH_ALL_USERS } from "../../common/redux/RATypes";

const defaultState = {
    users: [],
};

export default (state = defaultState, action) => {
	switch (action.type) {

		case FETCH_ALL_USERS:
			return {
				...state,
				users: action.result
			};

		default:
			return state
	}
}
